import React, { useState } from "react";
import InputField from '../components/InputField';
import ToggleButton from "../components/ToggleButton";

export default function IndexPage() {
  return (
    <div className="flex items-center justify-between">
      <img className="h-screen" src="https://mir-s3-cdn-cf.behance.net/project_modules/1400/68e7f197194893.5f4fde58dfa85.jpg"/>
      <div className="h-screen w-full bg-white flex items-center justify-center">
        <div className="w-auto space-y-5">
          <InputField type="text" required={true} placeholder="Enter your email address" label="Email" message="This email is valid."/>
          <InputField type="text" required={true} placeholder="Enter a username" label="Username" message="This username is available."/>
          <InputField type="password" required={true} placeholder="5+ characters" label="Password" message="This password is weak."/>
          <button className="py-2 w-full bg-indigo-600 text-white text-sm font-medium rounded-md hover:bg-indigo-700 focus:outline-none">Sign Up</button>
        </div>
      </div>
    </div>
  );
}
